import React, {useState} from "react";

function LoginForm(){
  const [username, setUsername] = useState("")
  const [password, setPassword] = useState("")
  const [confirmPassword, setConfirmPassword] = useState("")

  return(
    <form className="loginForm">
      <h2>Login</h2>
      <label htmlFor="inputUsername">username:</label>
      <input name="inputUsername" id="inputUsername" type="TEXT" placeholder="Username:" onChange={e => {setUsername(e.target.value);}}></input>
      <label htmlFor="inputPassword">Password:</label>
      <input name="inputPassword" id="inputPassword" type="PASSWORD" placeholder="Password:" onChange={e => {setPassword(e.target.value);}}></input>
      <label htmlFor="inputConfirmPassword">Confirm Password:</label>
      <input name="inputConfirmPassword" id="inputConfirmPassword" type="PASSWORD" placeholder="Password:" onChange={e => {setPassword(e.target.value);}}></input>      
      <a id="linkForgotPassword" href="...">Forgot Password</a>
      <div id="loginBtnGroup">
        <button id="btnLogin">Login</button>
        <button id="btnSignUp">Sign Up</button>
      </div>
    </form>
  )
}

export default function Login(){
  return(
    <div className="loginFormContainer">
      <LoginForm></LoginForm>
    </div>

  )
}
